--
-- Table structure for table `md_customer`
--

DROP TABLE IF EXISTS `md_customer`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `md_customer` (
  `customer_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '客户ID',
  `customer_code` varchar(64) NOT NULL COMMENT '客户编码',
  `customer_name` varchar(255) NOT NULL COMMENT '客户名称',
  `customer_nick` varchar(255) DEFAULT NULL COMMENT '客户简称',
  `customer_en` varchar(255) DEFAULT NULL COMMENT '客户英文名称',
  `customer_des` varchar(500) DEFAULT NULL COMMENT '客户简介',
  `customer_logo` varchar(255) DEFAULT NULL COMMENT '客户LOGO地址',
  `customer_type` varchar(64) DEFAULT 'ENTERPRISE' COMMENT '客户类型',
  `address` varchar(500) DEFAULT NULL COMMENT '客户地址',
  `website` varchar(255) DEFAULT NULL COMMENT '客户官网地址',
  `email` varchar(255) DEFAULT NULL COMMENT '客户邮箱地址',
  `tel` varchar(64) DEFAULT NULL COMMENT '客户电话',
  `first_cooperation_time` timestamp NULL DEFAULT NULL COMMENT '首次合作时间',
  `belong_salesman_name` varchar(255) DEFAULT NULL COMMENT '归属销售姓名',
  `salesman_id` bigint(20) DEFAULT NULL COMMENT '归属销售id',
  `belong_fae_name` varchar(255) DEFAULT NULL COMMENT '归属fae',
  `fae_id` bigint(20) DEFAULT NULL COMMENT 'fae人员id',
  `level_code` varchar(64) DEFAULT NULL COMMENT '客户等级code',
  `level` varchar(64) DEFAULT NULL COMMENT '客户等级',
  `add_method_code` varchar(64) DEFAULT NULL COMMENT '添加方式code',
  `add_method` varchar(64) DEFAULT NULL COMMENT '添加方式',
  `sales_stage_code` varchar(64) DEFAULT NULL COMMENT '销售阶段code',
  `sales_stage` varchar(64) DEFAULT NULL COMMENT '销售阶段',
  `company_scale` varchar(255) DEFAULT NULL COMMENT '公司规模',
  `products_type` varchar(255) DEFAULT NULL COMMENT '产品型号',
  `tag_name` varchar(500) DEFAULT NULL,
  `contact1` varchar(64) DEFAULT NULL COMMENT '联系人1',
  `contact1_tel` varchar(64) DEFAULT NULL COMMENT '联系人1-电话',
  `contact1_email` varchar(255) DEFAULT NULL COMMENT '联系人1-邮箱',
  `contact2` varchar(64) DEFAULT NULL COMMENT '联系人2',
  `contact2_tel` varchar(64) DEFAULT NULL COMMENT '联系人2-电话',
  `contact2_email` varchar(255) DEFAULT NULL COMMENT '联系人2-邮箱',
  `credit_code` varchar(64) DEFAULT NULL COMMENT '统一社会信用代码',
  `enable_flag` char(1) NOT NULL DEFAULT 'Y' COMMENT '是否启用',
  `remark` varchar(500) DEFAULT '' COMMENT '备注',
  `attr1` varchar(64) DEFAULT NULL COMMENT '预留字段1',
  `attr2` varchar(255) DEFAULT NULL COMMENT '预留字段2',
  `attr3` int(11) DEFAULT '0' COMMENT '预留字段3',
  `attr4` int(11) DEFAULT '0' COMMENT '预留字段4',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_by_id` bigint(20) DEFAULT NULL COMMENT '创建人id',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_by_id` bigint(20) DEFAULT NULL COMMENT '修改人id',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=598 DEFAULT CHARSET=utf8mb4 COMMENT='客户表';
/*!40101 SET character_set_client = @saved_cs_client */;

